    public static int lengthOfLongestSubstring(String s) {
        if (s.length() == 0) return 0;
        if (s.length() == 1) return 1;
        StringBuilder regex = new StringBuilder("([abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789!\\\\\"#$%&'()*+,-./:;<=>?@\\[\\]^_`{|}~ ])");
        Pattern pattern = Pattern.compile(regex.toString());
        Matcher matcher;
        for (int i = 0; i < s.length(); i++) {
            matcher = pattern.matcher(s);
            if (!matcher.find()) {
                return i;
            } else if (i + 1 == s.length()) {
                return i + 1;
            } else if (matcher.group(0).length() == 95) {
                return 95;
            } else {
                for (int j = 0; j < i + 1; j++) {
                    regex.append("(?!\\").append(j + 1).append(")");
                }
                regex.append("([abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789!\\\\\"#$%&'()*+,-./:;<=>?@\\[\\]^_`{|}~ ])");
                pattern = Pattern.compile(regex.toString());
            }
        }
        return 0;
    }
